import React from "react";
import { Button, Input } from "../../components";

const CreateBlog = () => {
  return (
    <div>
      <p>Create new Blog</p>
      <Input title="Post Title" />
      <p>Upload Image</p>
      <textarea></textarea>
      <Button title="Save" />
    </div>
  );
};

export default CreateBlog;
